import React from 'react';

import './index.css';

import { Table } from 'antd';

function TabelaUsuarios({dataSource,acoes}) {

    const columns = [
        {
            title: 'Código',
            dataIndex: 'id',
            key: 'id',

        },
        {
            title: 'Nome',
            dataIndex: 'nome',
            key: 'nome',
        },
        {
            title: 'Função',
            dataIndex: 'funcao',
            key: 'funcao',
        },
        acoes,
    ];

    return (  
        <Table dataSource={dataSource} columns={columns} className='Tabela' />   
    );
}

export default TabelaUsuarios;
